        // Координаты улиц (центров)
        var STREETS = [];

        // Названия улиц в том же порядке
        var STREET_NAMES = [];

        function dist(a,b) {
            var dx=a[0]-b[0];
            var dy=a[1]-b[1];
            return Math.sqrt(dx*dx + dy*dy);
        }

        function focusNearestStreet() {
            if(!navigator.geolocation) {
                alert("Геолокация не поддерживается");
                return;
            }
            if(STREETS.length == 0){
                alert("Нет данных об улицах");
                return;
            }

            navigator.geolocation.getCurrentPosition(function(pos){
                var user=[pos.coords.latitude, pos.coords.longitude];

                var bestIdx = 0;
                var bestD = dist(user, STREETS[0]);

                for(var i=1;i<STREETS.length;i++){
                    var d = dist(user, STREETS[i]);
                    if(d < bestD) {
                        bestD = d;
                        bestIdx = i;
                    }
                }

                var t = STREETS[bestIdx];

                // перевод в реальное расстояние
                // 1 градус широты ≈ 111.32 км
                var dLatKm = (user[0] - t[0]) * 111.32;
                var dLonKm = (user[1] - t[1]) * (40075 * Math.cos(user[0]*Math.PI/180) / 360);
                var distKm = Math.sqrt(dLatKm*dLatKm + dLonKm*dLonKm);

                var meters = Math.round(distKm*1000);
                var walkMin = Math.round((distKm/5)*60);

                MAP.flyTo([t[0], t[1]], 17);

                L.popup()
                .setLatLng([t[0], t[1]])
                .setContent(
                    "<b>Ближайшая улица:</b> " + STREET_NAMES[bestIdx] +
                    "<br><b>Расстояние:</b> " + meters + " м" +
                    "<br><b>Пешком:</b> примерно " + walkMin + " мин"
                )
                .openOn(MAP);
            },
            function(err) {
                alert("Ошибка геопозиции: " + err.message);
            },
            {enableHighAccuracy:true});
        }

        var btn=document.createElement("button");
        btn.textContent="Показать ближайшую улицу ко мне";
        btn.style.position="absolute";
        btn.style.top="10px";
        btn.style.left="50%";
        btn.style.transform="translateX(-50%)";
        btn.style.padding="8px 12px";
        btn.style.background="white";
        btn.style.border="1px solid #888";
        btn.style.borderRadius="6px";
        btn.style.zIndex=99999;
        btn.onclick = focusNearestStreet;
        document.body.appendChild(btn);
    });
    </script>
